  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for the
  bathymetry and shaded-relief maps of Offshore of Aptos map area, California. Bathymetry
  data are provided as two separate grids depending on mapping agency and processing
  method. The raster data files are included in \"BathymetryAHS_USGS_OffshoreAptos.zip,\"
  which is accessible from http://dx.doi.org/10.5066/F7K35RQB. The bathymetry and
  shaded-relief maps of Offshore Aptos, California, were generated from bathymetry
  data collected by the U.S. Geological Survey (USGS) and by California State University,
  Monterey Bay (CSUMB). Mapping was completed between 2006 and 2009 using a combination
  of a 244-kHz Reson 8101 multibeam echosounder and a 234-kHz SEA SWATHplus bathymetric
  sidescan-sonar system. The mapping missions collected bathymetry data from about
  the 10-m isobath to beyond the 3-nautical-mile limit of Californiau0092s State Waters.\",\n\t\"owner_org\":
